import React from "react";
import SideNav from "../pages/SideNav";

const TripleFrameRoute = ({children, webBrowserHeight}) => {
    return (
        <div className="withSideNavAndRightMargin">
            <SideNav webBrowserHeight={webBrowserHeight} />
            <div className='homeBox'>
                {children}
            </div>
            <div className='rightMarginBox'>
                 오른쪽여백
            </div>


        </div>
    );
};

export default TripleFrameRoute;
